"exports.run = {
    usage: ['sticker'],
    hidden: ['stiker', 's'],
    use: 'reply image/video',
    category: 'convert',
    async: async (m, {
        func,
        mecha,
        quoted,
        packname,
        author
    }) => {
        //if (m.isGc && !isPrem) return m.reply('Access denied.')
        try {
            if (/image\/(jpe?g|png)/.test(quoted.mime)) {
                let media = await quoted.download()
                if (!media) return m.reply(global.mess.wrong)
                return await mecha.sendSticker(m.chat, media, m, {
                    packname: packname,
                    author: author,
                    avatar: m.text.includes('--avatar'),
                    ai: m.text.includes('--ai'),
                    expiration: m.expiration
                })
            } else if (/video/.test(quoted.mime)) {
                if (quoted.seconds > 9) return m.reply('Maximum video duration is 9 seconds.')
                mecha.sendReact(m.chat, '🕒', m.key)
                let media = await quoted.download()
                if (!media) return m.reply(global.mess.wrong)
                return await mecha.sendSticker(m.chat, media, m, {
                    packname: packname,
                    author: author,
                    avatar: m.text.includes('--avatar'),
                    ai: m.text.includes('--ai'),
                    expiration: m.expiration
                })
            } else if (/webp/.test(quoted.mime)) {
                let media = await quoted.download()
                if (!media) return m.reply(global.mess.wrong)
                return await mecha.sendSticker(m.chat, media, m, {
                    packname: packname,
                    author: author,
                    avatar: m.text.includes('--avatar'),
                    ai: m.text.includes('--ai'),
                    expiration: m.expiration
                })
            } else m.reply(`Kirim atau reply gambar/video dengan caption ${m.cmd}`)
        } catch (error) {
            console.log(error);
            mecha.reply(m.chat, error.message, m, {
                expiration: m.expiration
            })
        }
    },
    limit: true
}"

"const axios = require('axios')

exports.run = {
    usage: ['quickchat', 'quickchat2', 'quickchat3', 'quickchat4'],
    hidden: ['qc', 'qc2', 'qc3', 'qc4'],
    use: 'text',
    category: 'convert',
    async: async (m, {
        func,
        mecha,
        packname,
        author
    }) => {
        if (!m.text) return m.reply(func.example(m.cmd, 'hello world'))
        if (m.text.length > 50) return m.reply('Max 50 character!')
        mecha.sendReact(m.chat, '🕒', m.key)
        try {
            let color;
            if (/^(quickchat|qc)$/.test(m.command)) color = '#CCFFFF'
            if (/^(quickchat2|qc2)$/.test(m.command)) color = '#000000'
            if (/^(quickchat3|qc3)$/.test(m.command)) color = '#999999'
            if (/^(quickchat4|qc4)$/.test(m.command)) color = '#FF9999'
            const obj = {
                type: "quote",
                format: "png",
                backgroundColor: color,
                width: 512,
                height: 768,
                scale: 2,
                messages: [{
                    entities: [],
                    avatar: true,
                    from: {
                        id: 5,
                        name: m.quoted ? global.db.users[m.quoted.sender].name : m.pushname,
                        photo: {
                            url: await mecha.profilePictureUrl(m.quoted ? m.quoted.sender : m.sender, 'image').catch(_ => 'https://telegra.ph/file/320b066dc81928b782c7b.png')
                        }
                    },
                    text: m.text,
                    replyMessage: {}
                }]
            }
            let res = await axios.post(global.quoteApi, obj, {
                headers: {
                    'Content-Type': 'application/json'
                }
            })
            const buffer = Buffer.from(res.data.result.image, 'base64');
            await mecha.sendSticker(m.chat, buffer, m, {
                packname: packname,
                author: author,
                expiration: m.expiration
            })
        } catch (error) {
            console.log(error);
            mecha.reply(m.chat, error.message, m, {
                expiration: m.expiration
            })
        }
    },
    //premium: true,
    restrict: true,
    limit: 3
}"

