        }));
        let hours = date.getHours();
        let minutes = date.getMinutes();
        let timeNow = `${hours.toString().padStart(2, '0')}:${minutes.toString().padStart(2, '0')}`;
        for (let [sholat, waktu] of Object.entries(jadwalSholat)) {
            if (timeNow === waktu) {
                // let txt = `Selamat menunaikan ibadah sholat ${sholat}`;
                mecha.autosholat[chatId] = [
                    mecha.sendMessage(m.chat, {
                        audio: {
                            url: 'https://files.catbox.moe/0nj6pp.mp3'
                        },
                        mimetype: 'audio/mpeg',
                        contextInfo: {
                            mentionedJchatId: [m.sender],
                            externalAdReply: {
                                title: `Waktu ${sholat} telah tiba, ambilah air wudhu dan segeralah sholat.`,
                                body: `${waktu} untuk wilayah Jakarta dan sekitarnya`,
                                mediaType: 1,
                                previewType: 'PHOTO',
                                sourceUrl: '',
                                // thumbnail: await func.fetchBuffer(thumb[sholat]),
                                thumbnailUrl: thumb[sholat],
                                renderLargerThumbnail: true
                            }
                        }
                    }, {
                        quoted: func.fverified,
                        ephemeralExpiration: m.expiration
                    }),
                    setTimeout(() => {
                        delete mecha.autosholat[chatId];
                    }, 1000 * 60 * 10)
                ];
            }
        }
    },
    location: 'plugins/event/_autosholat.js'
}"

"exports.run = {
    usage: ['listonline'],
    category: 'group',
    async: async (m, {
        func,
        mecha,
        store
    }) => {
        try {
            let id = m.args[0] && /\d+\-\d+@g.us/.test(m.args[0]) ? m.args[0] : m.chat;
            if (typeof store.presences[id] == 'undefined') return m.reply('Tidak ada peserta yang sedang online.');
            let online = [...Object.keys(store.presences[id]), m.bot];
            if (online.length > 0) {
                m.reply('Daftar peserta yang sedang online:\n\n' + online.map(v => '- @' + v.replace(/@.+/, '')).join('\n'))
            } else {
                m.reply('Tidak ada peserta yang sedang online.');
            }
        } catch {
            m.reply('Data kosong.');
        }
    },
    group: true
}"
